import React from "react";
import stilos from "./Paginado.module.css";

export default function Paginado({ pokemonesPerPage, allPokemones, paginado }) {
  const pageNumbers = [];
  for (let i = 1; i <= Math.ceil(allPokemones / pokemonesPerPage); i++) {
    pageNumbers.push(i);
  }
  return (
    <div className={stilos.pagination}>
      <ul>
        {pageNumbers &&
          pageNumbers.map((number) => (
            // <li key={number}>
            //   {/* <a
            //     href={#}
            //     onClick={() => paginado(number)}
            //     className={stilos.active}
            //   > */}

            <button onClick={() => paginado(number)} className={stilos.active}>
              {number}
            </button>

            //   {/* </a> */}
            // </li>
          ))}
      </ul>
    </div>
  );
}
